    if(percentage!==0){
        return(
            <div className="progress">
                <div 
                className="progress-bar progress-bar-striped bg-success"
                role="progressbar"
                style={{width:`${i}%`}}
                >
                {i}%
                </div>
            </div>
            );
    }else{
        return(
            <div className="progress">
                <div 
                className="progress-bar progress-bar-striped bg-success"
                role="progressbar"
                style={{width:`${0}%`}}
                >
                {0}%
                </div>
            </div>
            );
    }

  
};
Progress.propTypes= {
    percentage: PropTypes.number.isRequired
};
export default Progress
